import React from "react";
import "../App.css";
import { Tabs, TabList, Tab, Image } from '@chakra-ui/react'
import { extendTheme } from "@chakra-ui/react";
import logo from './UniversityOfWaterloo_logo_horiz_bk.png'

// Extend the default Chakra UI theme with your custom styles
const theme = extendTheme({
  components: {
    Tabs: {
      baseStyle: {
        tab: {
          textDecoration: "underline solid transparent",
          transition: "text-decoration 1s ease",
          _hover: {
            textDecoration: "underline solid Currentcolor"
          }
        }
      }
    }
  }
});

function HeaderBar() {
    return (
        <div>

        <Tabs align='center' variant="unstyled"  >
          <TabList>
            <Tab>About</Tab>
            <Tab>Projects</Tab>
            <Tab>Resume</Tab>
            <Tab>Github</Tab>
          </TabList>
        </Tabs>
      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
        <Tabs align='center' variant="unstyled">
          <TabList>
            <Tab>Khyle Dhanani</Tab>
          </TabList>
        </Tabs>
        <Tabs variant="unstyled">
          <TabList>
            <Tab>
              <Image
                boxSize={{ width: "10px", height: "10px" }}
                src={logo}
                alt='Dan Abramov'
                />
            </Tab>
          </TabList>
        </Tabs>
      </div>
        </div>
    );}

export default HeaderBar;
